#ask

Bagaimana cara menentukan maxwidth di bootstrap sesuai dengan ukuran pixel ?

Selama ini aku pakai css.

```
.maxwidth {
   margin-right: auto;
   margin-left: auto;
   max-width: 1366px; /* or 1360px */
}
```

Apakah ada cara lain dengan gaya bootstrap ?

Aku mau port tema-ku ke bootstrap, dan mengurangi custom css sebanyak-banyak.

Terimakasih sebelumnya 😎

Dasar reponsive bootstrap ada di **grid**.

🥁 https://getbootstrap.com/docs/4.0/layout/grid/

Kalau teliti, sempatkan membuka rincian di `_variables.scss`, yaitu

```
// Grid breakpoints
//
// Define the minimum dimensions at which your layout will change,
// adapting to different screen sizes, for use in media queries.

$grid-breakpoints: (
  xs: 0,
  sm: 576px,
  md: 768px,
  lg: 992px,
  xl: 1200px
) !default;
```

Semoga cukup menjelaskan 🙏🏽.

Misalnya begini di _variables.scss aku taruh:

```
// Variables

$yellow: #f7d316; // makara
$blue:   #2980b9; // monad
$dark:   darken($blue, 35%);
$gray:   #7b8a8b; 
$light:  #f8f9fa;

$border-radius: 4px;
$border-color:  $dark; // no default

$enable-gradients: true;

$border-radius:       0.625rem;
$border-radius-lg:    0.875rem;
$border-radius-sm:    0.375rem;
$badge-border-radius: 0.250rem;
```

Sebagai default value-nya untuk bootstrap.

